import React, {Component} from "react";
import TextFields from "../../../../components/textFieldUI/textField";
import Translate from "../../../../Translate";

class SearchItem extends Component {

    searchProductHandler = (value, name) => {
        this.props.setSearchProductValue(value, name)
    }


    render() {

        return (
            <tr>
                <td/>
                <td>
                    <TextFields
                        label={<Translate name={'search'}/>}
                        type={'search'}
                        value={this.props.searchProduct.sku}
                        name={'sku'}
                        onChange={event => this.searchProductHandler(event.target.value, event.target.name)}
                        style={{
                            width: '100%'
                        }}
                    />
                </td>
                <td>
                    <TextFields
                        label={<Translate name={'search'}/>}
                        type={'search'}
                        value={this.props.searchProduct.sku}
                        name={'name'}
                        onChange={event => this.searchProductHandler(event.target.value, event.target.name)}
                        style={{
                            width: '100%'
                        }}
                    />
                </td>
                <td>
                    <TextFields
                        label={<Translate name={'search'}/>}
                        type={'search'}
                        value={this.props.searchProduct.sku}
                        name={'suppliers'}
                        onChange={event => this.searchProductHandler(event.target.value, event.target.name)}
                        style={{
                            width: '100%'
                        }}
                    />
                </td>
                <td>
                    <TextFields
                        label={<Translate name={'search'}/>}
                        type={'search'}
                        value={this.props.searchProduct.sku}
                        name={'barcode'}
                        onChange={event => this.searchProductHandler(event.target.value, event.target.name)}
                        style={{
                            width: '100%'
                        }}
                    />
                </td>
                <td>
                    <TextFields
                        label={<Translate name={'search'}/>}
                        type={'search'}
                        value={this.props.searchProduct.sku}
                        name={'description'}
                        onChange={event => this.searchProductHandler(event.target.value, event.target.name)}
                        style={{
                            width: '100%'
                        }}
                    />
                </td>
                <td>
                    <TextFields
                        label={<Translate name={'search'}/>}
                        type={'search'}
                        value={this.props.searchProduct.sku}
                        name={'active'}
                        onChange={event => this.searchProductHandler(event.target.value, event.target.name)}
                        style={{
                            width: '100%'
                        }}
                    />
                </td>
                <td/>
            </tr>
        )
    }
}

export default SearchItem
